import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { addressCard } from '@fortawesome/free-solid-svg-icons'

const menu_bar = () => {

    const styleIcon = {
        size: "9x",
         flip: "horizontal",
          color: "yellow"
    }
    return (
        <nav className="nav">
          <ul>
              <li><a>
              <FontAwesomeIcon icon={addressCard} {...styleIcon}/>
                  Home
                 </a>
                </li>
          </ul>
        </nav>
    );
};

export default menu_bar;
